Here are a few popular compiler optimization techniques:

1. **Constant Folding**: This technique involves evaluating constant expressions at compile time rather than runtime. This can significantly improve performance by eliminating the need for runtime calculations.

   Example:
   ```c
   int x = 5 + 3; // Constant folding can be applied here
   ```

2. **Dead Code Elimination**: This technique removes code that is never executed or whose results are never used. This can help reduce the size of the compiled code and improve performance.

   Example:
   ```c
   int x = 5;
   int y = x + 3; // y is never used, so this line can be eliminated
   ```

3. **Common Subexpression Elimination**: This technique identifies expressions that are computed multiple times and replaces them with a single computation. This can help reduce the number of computations performed at runtime.

   Example:
   ```c
   int x = 5;
   int y = x + 3; // This expression is computed twice, so it can be replaced with a single computation
   int z = y + 2;
   ```

4. **Loop Optimization**: This technique optimizes loops to improve performance. One common loop optimization is **Loop Unrolling**, which involves unrolling loops to reduce the overhead of loop control code.

   Example:
   ```c
   for (int i = 0; i < 1000; i++) {
       // Some operation
   }
   ```
   Can be unrolled to:
   ```c
   for (int i = 0; i < 1000; i += 4) {
       // Some operation
       // Some operation
       // Some operation
       // Some operation
   }
   ```

5. **Function Inlining**: This technique replaces a function call with the actual code of the function. This can help reduce the overhead of function calls and improve performance.

   Example:
   ```c
   int add(int x, int y) {
       return x + y;
   }

   int main() {
       int x = add(5, 3); // This function call can be inlined
   }
   ```

